function setmuscul() {
	
	if (target_muscul == "Квадрицепс") {
        target_muscul_eng = "kvadriceps"; 	
    } 
	else if (target_muscul == "Грудные") {
       target_muscul_eng = "grudnyye";
    } 
    else if (target_muscul == "Бицепс") {
       target_muscul_eng = "bitseps";
    } 
	else if (target_muscul == "Бицепс бедра") {
       target_muscul_eng = "bitseps_bedra";
    } 
	else if (target_muscul == "Дельты") {
       target_muscul_eng = "delty";
    } 
	else if (target_muscul == "Голень") {
       target_muscul_eng = "golen";
    } 
	else if (target_muscul == "Пресс") {
       target_muscul_eng = "press";
    }
	else if (target_muscul == "Разгибатели спины") {
       target_muscul_eng = "razgibateli_spiny";
    }
	else if (target_muscul == "Шея") {
       target_muscul_eng = "sheya";
    }
	else if (target_muscul == "Широчайшая спины") {
       target_muscul_eng = "shirochayshaya_spiny";
    }
	else if (target_muscul == "Трапеция") {
       target_muscul_eng = "trapeze";
    }
	else if (target_muscul == "Трицепс") {
       target_muscul_eng = "triceps";
    }
	else if (target_muscul == "Ягодичная") {
       target_muscul_eng = "yagoditsy";
    }
	
	var img = "../../img/target_muscul/" + target_muscul_eng + ".png";

	
     var url = img;	
	 var el =  document.getElementById("muscul_img_1");
	 el.style.cssText="background-image: url(" + url + ");"; 
		
}

 
